width:100%;
height:100%;
display: flex;
justify-content: center;
align-items: center;
overflow: hidden;
position: relative;
`;

const Main = () => {
    return (
      <MainSection>
          <h1>kl</h1>
      </MainSection>
    );
};

export default Main
